DHFPROD-2176, DHFPROD-2206: Mapping step development

DHFPROD-2206: Get sample source documents via new sjsQuery endpoint that supports the cts queries used for source definition for steps. Example endpoint call:

POST http://localhost:4200/api/search/sjsSearch
{ "database": "data-hub-STAGING",
  "sourceQuery": "cts.collectionQuery([\"IngestStep\"])",
  "count": 1 }

Response:
[
  { "uri":"/data/doc1.json",
    "docs":{"envelope":{"headers":{},"triples":[],"instance":{"prop1":"a","prop2":"b","prop3":"c"},"attachments":null}}
  }
]

DHFPROD-2176: Store mapping artifacts separate from mapping steps, with mapping steps referencing their mapping artifacts in a "mapping" subobject. Flows and their associated steps are stored as JSON in [project-dir]/flows and mappings are stored as JSON in [project-dir]/mappings.

DHFPROD-1937: Smart Mastering config data for mocks

Added to Swagger endpoints:
GET  /flows
GET  /flows/{flowId}
PUT  /flows/{flowId}

Also added a static file for merging data.

Alteration to ALTER to disambiguate parsing of KEY {...}

Changed "ALTER VAR varname REAL KEY {...}" to "ALTER VAR varname REAL
ALTER KEY {...}".

small fixes

the database wasn't setted corrected if the jdbc url contained query parameters;
when columns where null the export was setting the value as empty and the restore process failed

Added NestedLoopJoin4OnLabel method to graphtests/Util.java
Added getRIDValue & setRIDValue to Convert.java
Added getRIDFld & setRIDFld to Tuple.java
Changed get_next() in IndexScan to return table of <Key, RID> when using index_only
Added a line "inner_tuple = inner.getNext(rid);" during while loop in NestedLoopsJoins.java
Added RID as Operand
Added attrNID to Projection.java and TupleUtils.java

---A similar function needed:
A nested loop join on descriptor, may need to change same files
Need to add support to IndexScan of ZIndex

*********************************
Below is the sample use of NestedLoopJoin4OnLabel
*********************************
Iterator nlj = Util.NestedLoopJoin4OnLabel("yhc",
                new NID(new PageId(3),1), new Descriptor(1,1,1,1,1));
        Tuple tuple = new Tuple();
        AttrType[] types = {
                new AttrType(AttrType.attrNID)
        };
        try {
            tuple.setHdr((short)1, types, null);
        } catch (IOException e) {
            e.printStackTrace();
        } catch (InvalidTypeException e) {
            e.printStackTrace();
        } catch (InvalidTupleSizeException e) {
            e.printStackTrace();
        }
        try {
            while ((tuple = nlj.get_next()) != null) {
                System.out.println(tuple.getNIDFld(1).pageNo.pid);
                System.out.println(tuple.getNIDFld(1).slotNo);
            }
        } catch (Exception e) {
            System.err.println("" + e);
            e.printStackTrace();
            Runtime.getRuntime().exit(1);
        }

1. Reformated some codes;
2. Optimized the code in nodeheap and edgeheap package;
3. Changed node label and edge label from variable length to fixed length (100 bytes), for the purpose of doing sorting conveniently.
